var express = require("express")
var app = express()
var bodyParser = require("body-parser")

app.use(bodyParser.urlencoded({extended: true}))
app.set("view engine", "ejs")

var campgrounds = [
    { name: "Camp Malta", image: "data:image/jpeg;base64,"},
    { name: "Wildebeest Eco Camp", image: "data:image/jpeg;base64," },
    { name: "Camp Ya Kanzi", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSClFTzIlTeDUlyTbAQANmSlvolJYxl8nnoKM9HrG8YoMW_YR5p" },
    { name: "Rapids Camp, Sagana", image: "data:image/jpeg;base64,"},
    { name: "Malewa Bush Ventures", image: "data:image/jpeg;base64," },
    { name: "Camp Carnelleys", image: "data:image/jpeg;base64," },
    { name: "El Karama", image: "data:image/jpeg;base64," },
    { name: "Kiboko Camp", image: "data:image/jpeg;base64," },
    { name: "Mamba Village", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSt1SFOCVjBA6ZCNnE6B2RQ_JCMb-tg2rl_2CEW8T0fRMejYLiQ" },
    { name: "Thompson Falls Lodge Camp", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQno76laIU6zk5ZBR9aqyaSrJRNl3W7AwpsHKBKfCfOpQV4_E5N"},
    { name: "Olorgesailie", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcScR8tgzL-7xe5EZGWOAOlLl7lDUo6s7KWAzSxQ4jdUlGFMYzuG" },
    { name: "Hell\'s Gate Gorge and National Park", image: "data:image/jpeg;base64," }
]

app.get("/", function(req, res){
    res.render("landing")
})

app.get("/campgrounds", function(req, res){
    res.render("campgrounds", {campgrounds: campgrounds})
})

app.post("/campgrounds", function(req, res){
    //get data from form and add to campgrounds array
    var name = req.body.name
    var image = req.body.image
    var newCampground = {name: name, image: image}
    campgrounds.push(newCampground)
    //redirect back to campgrounds page
    res.redirect("/campgrounds")
})

app.get("/campgrounds/new", function(req, res){
    res.render("new.ejs")
})

app.listen(3004, function(req, res){
    console.log("YelpCamp server serving on port 3004")
})